objetoCompra:
Serviço de manutenção preventiva e corretiva de equipamentos de processamento de dados e informática do Núcleo de Medicina Tropical - NMT, conforme descrição abaixo:

•	2 Microcomputadores DELL, tomb: 2025002492 e 2018000273; 
•	1 Projetor ACER, tom: 230127;
•	3 Impressoras Sansung, tomb: 261180, 235995 e 000917;
•	Nobreaks, tom: 261088 e 169401

Supressão de árvores: Supressão de 03 indivíduos arbóreos; Retirada de resíduos gerados; Acompanhamento de fiscalização dos serviços, realizado pelo responsável.
Fornecimento e plantio de mudas: Fornecimento e execução de plantio de 19 mudas; Manutenção por 1 ano;
 Fornecimento de 76 sacos de 20L de terra adubada;  Fornecimento de hidrogel;  Fornecimento de 19 tutores (estacas); Fornecimento de frete;  Fornecimento de relatórios com fotos para fundação parques e jardins.

informacaoComplementar:
Serviço de manutenção corretiva e substituição de peças com defeito para o equipamento microcentrífuga da marca Eppendorf, modelo 5424, número de série 5424AM540070, instalado no laboratório de Biologia Molecular.

O serviço de manutenção corretiva compreende:

a) troca da cuba de aço inox danificada;

b) substituição dos botões giratórios do painel danificados;

c)destravamento do rotor e testes de alinhamento.
